import React, { Component } from 'react';
import {
    Segment, Container, Divider, Grid
}
    from 'semantic-ui-react';

import './index.css';


class Body extends Component {

    render() {
        return (
            <div>
                <Segment className="footer-div">
                    <Grid columns={4} divided>
                        <Grid.Row>
                            <Grid.Column >
                                <Container className="footer-group"> </Container>
                            </Grid.Column>
                            <Grid.Column >
                                <Container className="footer-group"> </Container>
                            </Grid.Column>
                            <Grid.Column >
                                <Container className="footer-group"> </Container>
                            </Grid.Column>
                            <Grid.Column >
                                <Container className="footer-group"> </Container>
                            </Grid.Column>
                            </Grid.Row>
                    </Grid>
                </Segment>
            </div>
                    )
                }
            }
export default Body;
